import React, { useState } from 'react';
import Card from '../common/Card';
import Button from '../common/Button';
import { useAppContext } from '../../contexts/AppContext';

const SearchScreen = () => {
  const { searchResults, searchUsers } = useAppContext();
  const [searchQuery, setSearchQuery] = useState('');
  const [filters, setFilters] = useState({
    role: 'all',
    location: '',
    genres: []
  });
  const [showFilters, setShowFilters] = useState(false);

  const handleSearch = () => {
    searchUsers(searchQuery, filters);
  };

  const roles = ['all', 'DJ', 'Producer', 'Promoter', 'Venue', 'Agent'];
  const genres = ['House', 'Techno', 'Tech House', 'Minimal', 'Deep House', 'Melodic Techno'];

  return (
    <div className="screen search-screen">
      <div className="search-header">
        <div className="search-input-container">
          <input
            type="text"
            placeholder="Search artists, venues, promoters..."
            value={searchQuery}
            onChange={(e) => setSearchQuery(e.target.value)}
            onKeyPress={(e) => e.key === 'Enter' && handleSearch()}
          />
          <Button onClick={handleSearch}>Search</Button>
        </div>
        <Button 
          variant="text" 
          onClick={() => setShowFilters(!showFilters)}
        >
          Filters {showFilters ? '▲' : '▼'}
        </Button>
      </div>

      {showFilters && (
        <Card className="filters-section">
          <div className="filter-group">
            <label>Role</label>
            <div className="filter-options">
              {roles.map(role => (
                <button
                  key={role}
                  className={`filter-chip ${filters.role === role ? 'active' : ''}`}
                  onClick={() => setFilters({...filters, role})}
                >
                  {role}
                </button>
              ))}
            </div>
          </div>

          <div className="filter-group">
            <label>Location</label>
            <input
              type="text"
              placeholder="City or country"
              value={filters.location}
              onChange={(e) => setFilters({...filters, location: e.target.value})}
            />
          </div>

          <div className="filter-group">
            <label>Genres</label>
            <div className="filter-options">
              {genres.map(genre => (
                <button
                  key={genre}
                  className={`filter-chip ${filters.genres.includes(genre) ? 'active' : ''}`}
                  onClick={() => {
                    const newGenres = filters.genres.includes(genre)
                      ? filters.genres.filter(g => g !== genre)
                      : [...filters.genres, genre];
                    setFilters({...filters, genres: newGenres});
                  }}
                >
                  {genre}
                </button>
              ))}
            </div>
          </div>
        </Card>
      )}

      <div className="search-results">
        {searchResults.map(user => (
          <Card key={user.id} className="user-card">
            <div className="user-card-content">
              <img src={user.avatar} alt={user.name} className="user-avatar" />
              <div className="user-info">
                <h4>{user.name}</h4>
                <p className="user-role">{user.role}</p>
                <p className="user-location">{user.location}</p>
                <div className="user-genres">
                  {user.genres?.slice(0, 3).map(genre => (
                    <span key={genre} className="genre-tag">{genre}</span>
                  ))}
                </div>
              </div>
              <Button size="small">Connect</Button>
            </div>
          </Card>
        ))}
      </div>
    </div>
  );
};

export default SearchScreen;
